(90, 6, 1, 1, 'Family Bible of Richard and Kate Eason of Ashdon, Essex', 'Family Devotional Bible Containing The Authorised Version of The new and Old Testaments', 350, 270, 8300, 115, NULL, NULL, 'Front board warped and loose, staining to leather, spine detatched, evidence of rudimentary repairs – endpapers stuck together', 'Leather', 'The Eason family ran the village shop in Ashdon, Essex, and there is a display devoted to them in the Ashdon village museum. ', 'b00002', '2008-09-17', '20', 'Cambridge Books and Collectables', NULL, NULL, '', '2011-12-26 20:48:41', '2011-12-26 21:00:20', 0),
(91, 6, 1, 1, 'Family Bible of James Wright and Clara Pollard', 'The Illustrated Family Bible Containing The New And Old Testaments According To The Authorised Versions', 350, 270, 6800, 115, NULL, NULL, 'Leather worn, boards loose, spine detatched, binding tight', 'Leather', '', 'b00003', '2008-09-17', '20', 'Cambridge Books and Collectables', NULL, NULL, '', '2011-12-26 21:17:16', '2011-12-26 21:17:16', 0),
(92, 4, 1, 1, 'Family Bible of John Bowyer Jones', 'A Practical Family Bible on a Plan Entirely New Containing the Sacred Text of the Old and New Testament; Also the Apocrypha', 410, 265, 6300, 100, NULL, NULL, '', 'Leather', 'A large leatherbound Bible, with evidence of a crude repair in it''s long life that would benefit from some basic restoration.  A fascinating and beautiful family register makes this one of my favourite stock pieces yet.  Containing a family regsiter across two pages detailing the parents and siblings of the John Bowyer Jones written in a number of styles and in total listing 15 individuals with dates ranging from 1815 - 1897 with other un dated individuals extending back into the 1700s.  There is nolocation information in the Bible,but we do know John Bowyer Jones died in Monmouthshire, Wales in 1869.', 'b00004', '2009-11-10', '30', 'G David, Cambridge', NULL, '145', '', '2011-12-26 21:27:40', '2011-12-27 20:16:52', 0),
(93, 5, 1, 1, 'Bible of Emma Hanchett (1837 - 1909) of Newport, Essex', 'The Holy Bible Containing the Old and New Testaments', 240, 155, 1400, 62, NULL, 1256, 'Some wear to spine, but otherwise tight and complete.  some foxing on endpapers', 'Leather', 'It took us a while to unravel this one - a small leatherbound Bible with nice inscription and family details written on front and back endpapers.   The inscription reads "Mrs Woolner presented by Mrs Binn of Shortgrove".  We believe "Shortgrove" refers to Shortgrove Hall, a large country estate on the outskirts of Newport in Essex.  we acquired the Bible just three miles from Newport in Essex.  The family details were tantalisingly incomplete.  A list of four children: Elizabeth Hanchett, Frank Woolner, Alice Susanna Woolner and Florence Ethel Woolner.  Birthdates are given but not the years, except for Elizabeth Hancett who is given as being born in 1867.  Emma Hanchett is only referred to in the inscription as Mrs Woolner, and this is followed by "Dear Mother entered into eternal rest May 29th 1909".  Her husband, John Woolner is only referred to in a similar death notice: "Dear Dad passed away Dec 8th 1901".  We have been able to determine from these details that this Bible definitely belonged to Emma Woolner nee Hanchett of Newport in Essex.  There are further details on the rear endpapers that time does not allow us to research (we have spent longer on this Bible than ones that sell for ten times the amount!).  Five children and birth dates but only two birth years: Catherine Elizabeth Bailey (July 6th), Lizzie Maud Bailey (June 5th), Alice Dora Bailey (Sep 15th), Reginald John Weston (July 19th 1900) and Violet Alice Weston (Sep 12th 1905).  The Bible has a few inserts that we have left in situ: a few pressed leaves, a shred of material, a clipping of a John Wesley quotation.   A very tight and usable Bible with an interesting history at a very reasonable price.', 'b00005', '2009-11-13', '5', 'Lankasters, Saffron Walden', NULL, '45', 'Mick Woolmer', '2011-12-27 20:02:35', '2011-12-27 20:15:02', 0),
(94, 4, 1, 1, 'Two Volume Leatherbound New Testament with Family Register of the Dance, Spurrell & Richardson families of Suffolk from c1680 - c1890', 'A Commentary On The New Testament by Thomas Coke (2 Vols)', 280, 240, 5930, 170, NULL, NULL, 'Generally Sound though worn', 'Leather', 'A two volume leather bound set of Thomas Coke''s "Commentary on the New Testament", published 1803 and bearing a small leather and gold tooled book plate on the front end paper in the name of W. S. Dance.  The Bible set contains a comprehensive four page family register of the Dance and Spurrell family, naming individuals who lived on the Suffolk coast between 1680s - 1890s.  We believe from the information given in the Bible that it was the property of William Dance and his wife (and cousin) Susanna Richardson who moved to Lowestoft in December 1798 following their marriage in November 1798.  William''s father is listed as being of Aldborough, which we believe to be Aldeburgh on the Suffolk coast.  The genealogical details in the family register, covering four pages of neat handwritting, although scant on location information, gives one of the most detailed ancestral lists we''ve ever seen.  Unusually for unrestored Bibles, the boards are attached, and the leatherbinding, though scuffed in places, is in remarkable good condition with some gold tooling still visible.  The binding is tight, and the family register is clear and unblemished.  In need of little restoratation, these volumes have a understated gravitas.  Thomas Coke was one of the founders of American Methodism, and his Commentary on the New Testament is considered to be an important theological work, perhaps shedding some interesting light on the religious views of William and Susanna Dance.   Coke was born in Brecon, Wales, the son of a medical practitioner. He was educated at Brecon Grammar School and Jesus College, Oxford, and was elected mayor of Brecon shortly after graduating in 1768. Coke took Holy Orders in August 1772 but was ejected from his curacy in Somerset for trying to run the parish on Methodist principles. He moved to London and placed himself under the direction of John Wesley, swiftly reaching a position of prominence.', 'b00007', '2010-01-01', '45', 'Lankasters, Saffron Walden', NULL, '200', '', '2011-12-28 21:03:34', '2011-12-28 21:03:34', 0),
(95, 4, 1, 1, 'Family Bible of George Lambert Clifford and Mary Coyney with Arisocratic Provenence', 'The Holy Bible translated from The Latin Vulgat', 375, 260, 5480, 100, NULL, NULL, 'General sound and tight.  Hinges split and missing spine', 'Leather', ' A Large Regency period Vulgat Bible with a very complete and detailed genealogy across 6 pages of George Lambert Clifford, detailing date, time, sex, location, name & christening details of 12 children (including one miscarriage) and 6 grandchildren, as well as some information about their parents.  Particularly interesting for it’s Aristocratic provenance: The eldest child who’s birth is detailed was Charles Clifford, who went on to be the first speaker of the New Zealand House of Representatives. It also contains details about children which don’t appear to be hitherto documented.  A gedcom or high resolution images of the extensive family register are available on request.  A wonderful item, with relevance to both the Clifford family and to scholars of New Zealand or the Aristoracy.   The Bible is tight and complete, but missing the spine.  We can quote for complete restoration, please contact us.', 'b00006', '2010-06-08', '50', 'Lankasters, Saffron Walden', NULL, '1250', '', '2011-12-28 21:38:01', '2011-12-29 00:55:54', 0),
(96, 4, 16, 1, 'Will of Edward Billett of St Neots, Cambridgeshire (1789)', '', 350, 233, 40, 2, NULL, 7, '', '', 'A solicitors copy of the Will of Mr E. Billet dated 2nd December 1789, handwritten across seven pages of paper watermarked "K Shutton Mill, 1806", and pinned in the top left hand corner.', 'w00001', '2009-12-02', '10', 'The Old Curiosity Shop, Huntingdon', NULL, '50', '', '2011-12-29 10:29:48', '2011-12-29 10:29:48', 0),
(97, 6, 20, 1, 'Memorial to family of Robert English, of Ely (1786)', '', NULL, NULL, NULL, NULL, NULL, NULL, '', '', 'Memorial plaque to the family of Robert English of Ely on the external North wall of Ely Cathedral, Cambridgeshire', 'mem00001', '2012-01-08', NULL, '', NULL, NULL, '', '2012-01-08 17:22:59', '2012-01-08 17:28:23', 0),
(98, 6, 20, 1, 'Memorial to Protestant Martyrs William Wolsey and Robert Pygot, Ely, Cambridgeshire', '', NULL, NULL, NULL, NULL, NULL, NULL, '', '', 'Memorialin Ely, Cambridgeshire  to William Wolsey, Constable of Welney, Upware and Outwell, and Robert Pygot, painter of Wisbech,  burnt at the stake for their Christian faith, 16th October 1555.  The memorial is located just off MInster Place by Cross Green, at ankle level.', 'mem00002', NULL, NULL, '', NULL, NULL, '', '2012-01-08 17:38:23', '2012-01-08 17:40:52', 0),
(99, 6, 21, 1, 'Inn sign with coach information, Ely, Cambridgeshire', '', NULL, NULL, NULL, NULL, NULL, NULL, '', '', 'Painted Inn sign, including stagecoach information in situ on building in Market Street, Ely, Cambridgeshire', 'sign00001', NULL, NULL, '', NULL, NULL, '', '2012-01-08 17:54:08', '2012-01-08 17:59:02', 0);
